import logo from "../images/Logo-Mesto-Russia.svg"

function Header({ email }) {
  return (
    <header className="header">
        <img src={logo} className="header__logo" alt="Логотип"/>
        <div>
          <p>{email}</p>
          <p></p>
        </div>
    </header>
  );
}

export default Header;
